import React, { Component } from 'react';
import { Row, Col } from 'antd';
import './ImportingRequest.style.scss';

export default class ImportingRequest extends Component {
  render() {
    return (
      <div className="importing-request">
        <div className="importing-request__container">
          <Row gutter={15} style={{ width: '100%', height: '100%' }}>
            <Col span={4}>
              <div className="importing-request__container__block"></div>
            </Col>
            <Col span={4}>
              <div className="importing-request__container__block"></div>
            </Col>
            <Col span={4}>
              <div className="importing-request__container__block"></div>
            </Col>
          </Row>
        </div>
      </div>
    )
  }
}
